//Same structure goes...

var limit = 3;
var lapChangeAnnouncementTimeout = 1;
var gameEndTimeout = 2000;

var Circuits = [Circuit1,Circuit2]; //...

var _Circuits = [_Circuit1,_Circuit2]; //...
var _Circuit = {MinX: 0, MaxX: 0, MinY: 0, MaxY: 0, DriveDirection: 0, StartDirection: undefined, Name: undefined, BestTime: [999.99,undefined], MainColor: [0x000000,0x000000,0x000000], AvatarColor: 0x000000, Angle: 0, Team: 0, ID: 0};

var colors = {commands: 0xFFFFFF, info: 0xFFFFFF, lapChanged: 0xFFFFFF, lapTime: 0x2DF73B, mapChangeWrongName: 0xFFFF00, mapChangeDeny: 0xFF0000, mapLoad: 0x80FF00, mapLoadDeny: 0xFFFF00, speed: 0x2DF73B, trackRecord: 0xFF33D0};
var fonts = {commands: "normal", info: "normal", lapChanged: "normal", lapTime: "normal", mapChangeWrongName: "normal", mapChangeDeny: "bold", mapLoad: "normal", mapLoadDeny: "normal", speed: "small", trackRecord: "bold"};
var sounds = {commands: 1, info: 0, lapChanged: 1, lapTime: 1, mapChangeWrongName: 1, mapChangeDeny: 2, mapLoad: 1, mapLoadDeny: 1, speed: 0, trackRecord: 1};

var playerList = {};
var commands = {admin: "!admin", commands: "!commands", mapInfo:"!map", mapLoad: "!circuit", maps: "!maps", speed: "!speed"};

var adminChanges = ["'s admin rights were taken away"," was given admin rights"];
var playerKicked = [" was kicked"," was banned"];
var speedEnableChanges = ["OFF","ON"];
var teams = ["spectators","red","blue"];

var isRoomSet = false;

var room = HBInit({roomName:"F1 RACING BOT TEST ROOM",noPlayer:true,public:true,maxPlayers:12,password:"1234567890"});

room.setScoreLimit(0);
room.setTimeLimit(0);
room.setTeamsLock(true);
room.setCustomStadium(Circuit1);

function checkIfTrolling(){
    var players = room.getPlayerList().filter(p => room.getPlayerDiscProperties(p.id) != null && ifInLapChangeZone(p) == true);

    players.forEach(p => {
	if(_Circuit.StartDirection == "X"){
	    if(Math.sign(room.getPlayerDiscProperties(p.id).xspeed) == -1 * _Circuit.DriveDirection){
		room.kickPlayer(p.id,"Trolling detected!",false);
	    }
	}
	else if(_Circuit.StartDirection == "Y"){
	    if(Math.sign(room.getPlayerDiscProperties(p.id).yspeed) == -1 * _Circuit.DriveDirection){
		room.kickPlayer(p.id,"Trolling detected!",false);
	    }
	}
    });
}

function checkPlayerLaps(){
    var players = room.getPlayerList().filter(p => room.getPlayerDiscProperties(p.id) != null);

    players.forEach(p => {
	if(playerList[p.name].currentLap <= limit){
	    playerList[p.name].lapTimes[playerList[p.name].currentLap-1] += 1/60;
	}
	if(!ifInLapChangeZone(p) && playerList[p.name].lapChanged == true){
	    playerList[p.name].lapChanged = false;
	}
	if(ifInLapChangeZone(p) && playerList[p.name].lapChanged == false){
	    if(playerList[p.name].currentLap < limit){
		playerList[p.name].currentLap++;
		playerList[p.name].lapChanged = true;
		var name = p.name;
		var id = p.id;
		var _p = p;
		var index = _Circuits.findIndex(c => c.Name == _Circuit.Name);
		setTimeout(p => {
		    if(playerList[name].currentLap > 1){
			var lapTime = parseFloat(playerList[name].lapTimes[playerList[name].currentLap-2]);
			room.sendAnnouncement(`⏱ Lap ${playerList[name].currentLap-1}: ${serialize(lapTime)} seconds`,id,colors.lapTime,fonts.lapTime,sounds.lapTime);
			if(lapTime < _Circuit.BestTime[0]){
			    room.sendAnnouncement(`🆕 Track record! ${name} - ${serialize(lapTime)} seconds`,null,colors.trackRecord,fonts.trackRecord.trackRecord);
			    _Circuit.BestTime = [lapTime,name];
			    _Circuits[index].BestTime = [lapTime,name];
			}
			if(playerList[name].lapTimes[playerList[name].currentLap-2] != 0){
			    playerList[name].lapTimes[playerList[name].currentLap-2] = 0;
			}
		    }
		    room.sendAnnouncement(`Lap ${playerList[name].currentLap}/${limit}`,id,colors.lapChanged,fonts.lapChanged,sounds.lapChanged);
		},lapChangeAnnouncementTimeout);
	    }
	    else{
		playerList[p.name].currentLap++;
		playerList[p.name].lapChanged = true;
		var name = p.name;
		var id = p.id;
		var _p = p;
		var index = _Circuits.findIndex(c => c.Name == _Circuit.Name);
		setTimeout(p => {
		    var lapTime = parseFloat(playerList[name].lapTimes[playerList[name].currentLap-2]);
		    room.sendAnnouncement(`⏱ Lap ${playerList[name].currentLap-1}: ${serialize(lapTime)} seconds`,id,colors.lapTime,fonts.lapTime,sounds.lapTime);
		    if(lapTime < _Circuit.BestTime[0]){
			room.sendAnnouncement(`🆕 Track record! ${name} - ${serialize(lapTime)} seconds`,null,colors.trackRecord,fonts.trackRecord.trackRecord);
			_Circuit.BestTime = [lapTime,name];
			_Circuits[index].BestTime = [lapTime,name];
		    }
		    if(playerList[name].lapTimes[playerList[name].currentLap-2] != 0){
			playerList[name].lapTimes[playerList[name].currentLap-2] = 0;
		    }
		    room.sendAnnouncement(`You have completed your laps!`,id,colors.lapChanged,fonts.lapChanged,sounds.lapChanged);
		    room.setPlayerTeam(id,0);
		},lapChangeAnnouncementTimeout);
	    }
	}
    });
}

function endRaceSession(){
    var players = room.getPlayerList().filter(p => room.getPlayerDiscProperties(p.id) != null);
    var id = _Circuits.findIndex(c => c.Name == _Circuit.Name);
    var next = Circuits[id+1];

    if(room.getScores() != null){
	if(players.length == 0){
	    room.stopGame();
	    setTimeout(function(){
		if(id < Circuits.length){
		    room.setCustomStadium(next);
		    room.startGame();
		}
		else{
		    room.setCustomStadium(Circuits[0]);
		    room.startGame();
		}
	    },gameEndTimeout);
	}
    }
}

function ifInLapChangeZone(player){
    return room.getScores().time > 0 && _Circuit && _Circuit.MinX <= room.getPlayerDiscProperties(player.id).x && room.getPlayerDiscProperties(player.id).x <= _Circuit.MaxX && _Circuit.MinY <= room.getPlayerDiscProperties(player.id).y && room.getPlayerDiscProperties(player.id).y <= _Circuit.MaxY;
}

function logPlayerSpeed(){
    var players = room.getPlayerList().filter(p => room.getPlayerDiscProperties(p.id) != null && playerList[p.name].speedEnabled == true);

    players.forEach(p => {
	room.setPlayerAvatar(p.id,(Math.floor(10*Math.hypot(room.getPlayerDiscProperties(p.id).xspeed,room.getPlayerDiscProperties(p.id).yspeed))).toString());
    });
}

function serialize(number){
    return number.toFixed(3);
}

room.onGamePaused = function(byPlayer){
    byPlayer == null ? console.log(`Game paused`) : console.log(`Game paused by ${byPlayer.name}`);
}

room.onGameStart = function(byPlayer){
    byPlayer == null ? console.log(`Game started`) : console.log(`Game started by ${byPlayer.name}`);

    var players = room.getPlayerList();
    players.forEach(p => {
	playerList[p.name].currentLap = 0;
	playerList[p.name].lapChanged = false;
	for(var l=0; l<playerList[p.name].lapTimes.length; l++){
	    playerList[p.name].lapTimes[l] = 0;
	}
    });
}

room.onGameStop = function(byPlayer){
    byPlayer == null ? console.log(`Game stopped`) : console.log(`Game stopped by ${byPlayer.name}`);

    var players = room.getPlayerList();
    players.forEach(p => {
	playerList[p.name].currentLap = 0;
	playerList[p.name].lapChanged = false;
	for(var l=0; l<playerList[p.name].lapTimes.length; l++){
	    playerList[p.name].lapTimes[l] = 0;
	}
    });
}

room.onGameTick = function(){
    checkIfTrolling();
    checkPlayerLaps();
    endRaceSession();
    logPlayerSpeed();
}

room.onGameUnpaused = function(byPlayer){
    byPlayer == null ? console.log(`Game unpaused`) : console.log(`Game unpaused by ${byPlayer.name}`);
}

room.onKickRateLimitSet = function(min,rate,burst,byPlayer){
    byPlayer == null ? console.log(`Kick rate limit set as min: ${min} max: ${max} burst: ${burst}`) : console.log(`Kick rate limit set as min: ${min} max: ${max} burst: ${burst} by ${byPlayer.name}`);
}

room.onPlayerAdminChange = function(changedPlayer,byPlayer){
    byPlayer == null ? console.log(`${changedPlayer.name}${adminChanges[Number(changedPlayer.admin)]}`) : console.log(`${changedPlayer.name}${adminChanges[Number(changedPlayer.admin)]} by ${byPlayer.name}`);
}

room.onPlayerChat = function(player,message){
    console.log(`${player.name}: ${message}`);

    if(player.admin == true){
	if(message.toLowerCase().split(" ")[0] == commands.admin){
	    room.setPlayerAdmin(player.id,!player.admin);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.commands){
	    room.sendAnnouncement("Available commands: !admin, !circuit [ID], !commands, !map, !maps, !speed",player.id,colors.commands,fonts.commands,sounds.commands);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.mapInfo){
	    room.sendAnnouncement(`${_Circuit.Name} best lap: ${serialize(_Circuit.BestTime[0])} seconds by ${_Circuit.BestTime[1]}`,player.id,colors.mapInfo,fonts.mapInfo,sounds.mapInfo);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.mapLoad){
	    var id = message.toLowerCase().split(" ")[1];

	    if(id < 1 || id > _Circuits.length){
		room.sendAnnouncement(`Invalid ID`,player.id,colors.mapLoadDeny,fonts.mapLoadDeny,sounds.mapLoadDeny);
	    }
	    else{
		room.setCustomStadium(Circuits[id-1]);
		room.sendAnnouncement(`${_Circuits[id-1].Name} was loaded by ${player.name}`,null,colors.mapLoad,fonts.mapLoad,sounds.mapLoad);
	    }
	    
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.maps){
	    room.sendAnnouncement(`Map list below:\n${_Circuits.map(c => c.Name + " [" + c.ID + "]").join('\n')}`,player.id,colors.info,fonts.info,sounds.info);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.speed){
	    playerList[player.name].speedEnabled = !playerList[player.name].speedEnabled;
	    room.sendAnnouncement(`Speed is turned ${speedEnableChanges[Number(playerList[player.name].speedEnabled)]}`,player.id,colors.speed,fonts.speed,sounds.speed);

	    if(playerList[player.name].speedEnabled == true)
		room.setPlayerAvatar(player.id);

	    return false;
	}
    }
    else{
	if(message.toLowerCase().split(" ")[0] == commands.admin){
	    room.setPlayerAdmin(player.id,!player.admin);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.commands){
	    room.sendAnnouncement("Available commands: !admin, !commands, !map, !speed",player.id,colors.commands,fonts.commands,sounds.commands);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.mapInfo){
	    room.sendAnnouncement(`${_Circuit.Name} best lap: ${serialize(_Circuit.BestTime[0])} seconds by ${_Circuit.BestTime[1]}`,player.id,colors.mapInfo,fonts.mapInfo,sounds.mapInfo);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.speed){
	    playerList[player.name].speedEnabled = !playerList[player.name].speedEnabled;
	    room.sendAnnouncement(`Speed is turned ${speedEnableChanges[Number(playerList[player.name].speedEnabled)]}`,player.id,colors.speed,fonts.speed,sounds.speed);

	    if(playerList[player.name].speedEnabled == true)
		room.setPlayerAvatar(player.id);

	    return false;
	}
    }
}

room.onPlayerKicked = function(kickedPlayer,reason,ban,byPlayer){
    byPlayer == null ? console.log(`${kickedPlayer.name} ${playerKicked[Number(ban)]} (${reason})`) : console.log(`${kickedPlayer.name} ${playerKicked[Number(ban)]} by ${byPlayer.name} (${reason})`);
}

room.onPlayerJoin = function(player){
    console.log(`${player.name} has joined`);
    var players = room.getPlayerList();

    var lapTimes = [];
    for(var i=0; i<limit; i++){
	lapTimes.push(0);
    }

    if(playerList[player.name] == undefined)
	playerList[player.name] = {name: player.name, id: player.id, currentLap: 0, lapChanged: false, lapTimes: lapTimes, speedEnabled: false, isInTheRoom: true};

    if(room.getScores() == null && players.length == 1){
	if(_Circuit.Team != 0)
	    room.setPlayerTeam(player.id,_Circuit.Team);

	room.startGame();
    }
}

room.onPlayerLeave = function(player){
    console.log(`${player.name} has left`);
    var players = room.getPlayerList();

    playerList[player.name].currentLap = 0;
    playerList[player.name].lapChanged = false;
    playerList[player.name].isInTheRoom = false;

    if(room.getScores() != null && players.length == 0){
	room.stopGame();
    }
}

room.onPlayerTeamChange = function(changedPlayer,byPlayer){
    byPlayer == null ? console.log(`${changedPlayer.name} was moved to ${teams[changedPlayer.team]}`) : console.log(`${changedPlayer.name} was moved to ${teams[changedPlayer.team]} by ${byPlayer.name}`);

    playerList[changedPlayer.name].currentLap = 0;
    playerList[changedPlayer.name].lapChanged = false;
}

room.onPositionsReset = function(){
    var players = room.getPlayerList();
    players.forEach(p => {
	playerList[p.name].currentLap = 0;
	playerList[p.name].lapChanged = false;
	for(var l=0; l<playerList[p.name].lapTimes.length; l++){
	    playerList[p.name].lapTimes[l] = 0;
	}
    });
}

room.onRoomLink = function(url){
    if(isRoomSet == false){
	console.log(`Room set with url: ${url}`);
	isRoomSet = true;
    }
}

room.onStadiumChange = function(newStadiumName,byPlayer){
    byPlayer == null ? console.log(`${newStadiumName} was loaded`) : console.log(`${newStadiumName} was loaded by ${byPlayer.name}`);

    var c = _Circuits.find(x => x.Name == newStadiumName);
    var players = room.getPlayerList();
    var admins = room.getPlayerList().filter(p => p.admin == true);

    players.forEach(p => room.setPlayerTeam(p.id,c.Team));

    if(byPlayer == null){
	if(c){
	    _Circuit = {MinX: c.MinX, MaxX: c.MaxX, MinY: c.MinY, MaxY: c.MaxY, DriveDirection: c.DriveDirection, StartDirection: c.StartDirection, Name: c.Name, BestTime: [c.BestTime[0],c.BestTime[1]], MainColor: c.MainColor, AvatarColor: c.AvatarColor, Angle: c.Angle, Team: c.Team, ID: c.ID};
	    room.setTeamColors(c.Team,c.Angle,c.AvatarColor,c.MainColor);
	}
	else{
	    admins.length > 0 ? admins.forEach(p => room.sendAnnouncement(`Something went wrong with map ${newStadiumName}. Please try again!`,p.id,colors.mapChangeWrongName,fonts.mapChangeWrongName,sounds.mapChangeWrongName)) : room.sendAnnouncement(`Something went wrong with map ${newStadiumName}. Please call an admin to try again!`,null,colors.mapChangeWrongName,fonts.mapChangeWrongName,sounds.mapChangeWrongName);
	}
    }
    else{
	room.sendAnnouncement("You don't have authorization to change maps in this room!",byPlayer.id,colors.mapChangeDeny,fonts.mapChangeDeny,sounds.mapChangeDeny);
	room.setCustomStadium(Circuits[0]);
    }
}
